import React from "react";
const Preview = (props) =>{
    const {tasks} = props;

    const listItems = tasks.map((personalInfo)=>
        <div key={personalInfo.id}>{personalInfo.name}{personalInfo.email}{personalInfo.phone}</div>

    );

    return(
        <ul>{listItems}</ul>
    )
}

const PreviewEducation = (props)=>{
    const {tasks} = props;
    const listItems = tasks.map((educationInfo)=>
    <div key={educationInfo.id}>{educationInfo.name}{educationInfo.title}{educationInfo.date}{educationInfo.dateEnd}</div>
    );

    return(
        <ul>{listItems}</ul>
    )
}

export  {Preview, PreviewEducation};
